function buildHistogram(values, nBins) {
  const min = values[0];
  const max = values[values.length - 1];
  const range = max - min || 1;
  const binWidth = range / nBins;
  const bins = [];
  const labels = [];
  for (let i = 0; i < nBins; i++) {
    bins.push(0);
    const lo = min + i * binWidth;
    const hi = lo + binWidth;
    labels.push(fmt(lo) + '~' + fmt(hi));
  }
  for (const v of values) {
    let idx = Math.floor((v - min) / binWidth);
    if (idx >= nBins) idx = nBins - 1;
    bins[idx]++;
  }
  return { bins, labels };
}

      <tr><td>${fmt(dd.p95 * 0.5)}ÂÜÜ</td><td>0.5ÂÄçÔºà50Ê†™Ôºâ</td><td>‰ΩôË£ï„ÇíÊåÅ„Å£„ÅüÈÅãÁî®</td></tr>
      <tr><td>${fmt(dd.p95 * 2)}ÂÜÜ</td><td>2.0ÂÄçÔºà200Ê†™Ôºâ</td><td>Êîª„ÇÅ„ÅüÈÅãÁî®ÔºàDD2ÂÄç„É™„Çπ„ÇØÔºâ</td></tr>
    </table>

    <div class="insight">
      Ëá™ÂàÜ„ÅÆË®±ÂÆπÊêçÂ§±È°ç„ÅåÊ±∫„Åæ„Å£„Å¶„ÅÑ„Çå„Å∞„ÄÅ95%„Éâ„É≠„Éº„ÉÄ„Ç¶„É≥Ôºà-${fmt(dd.p95)}ÂÜÜÔºâ„ÅßÂâ≤„Çã„Åì„Å®„ÅßÊúÄÂ§ß„Éù„Ç∏„Ç∑„Éß„É≥„Çµ„Ç§„Ç∫„ÅåÊ±∫„Åæ„Çã„ÄÇ<br>
      ‰æã: Ë®±ÂÆπÊêçÂ§±50‰∏áÂÜÜ ‚Üí 50‰∏á √∑ ${fmt(dd.p95)} ‚âà ${(500000 / dd.p95).toFixed(1)}ÂÄç „Åå‰∏äÈôê„ÄÇ
    </div>
  `;

  document.getElementById('content').innerHTML = html;
  drawHistogram('ddCanvas', dd.values, '#ef4444', dd.p95, 'DD 95%');
  drawHistogram('pnlCanvas', pnl.values, '#10b981', pnl.p5, 'PnL 5%');
}

function drawHistogram(canvasId, values, color, threshold, thresholdLabel) {
  const canvas = document.getElementById(canvasId);
  const ctx = canvas.getContext('2d');
  const W = canvas.offsetWidth;
  const H = 200;
  canvas.width = W * 2;
  canvas.height = H * 2;
  ctx.scale(2, 2);

  const nBins = 50;
  const hist = buildHistogram(values, nBins);
  const maxCount = Math.max(...hist.bins);
  const min = values[0];
  const max = values[values.length - 1];
  const range = max - min || 1;

  const pad = { l: 50, r: 16, t: 8, b: 24 };
  const plotW = W - pad.l - pad.r;
  const plotH = H - pad.t - pad.b;

  // bars
  const barW = plotW / nBins;
  for (let i = 0; i < nBins; i++) {
    const h = maxCount > 0 ? (hist.bins[i] / maxCount) * plotH : 0;
    const x = pad.l + i * barW;
    const y = pad.t + plotH - h;
    const binCenter = min + (i + 0.5) * (range / nBins);
    const isThreshold = canvasId === 'ddCanvas' ? binCenter >= threshold : binCenter <= threshold;
    ctx.fillStyle = isThreshold ? '#f59e0b' : color;
    ctx.globalAlpha = 0.7;
    ctx.fillRect(x, y, barW - 1, h);
  }
  ctx.globalAlpha = 1;

  // threshold line
  const tx = pad.l + ((threshold - min) / range) * plotW;
  ctx.strokeStyle = '#f59e0b';
  ctx.lineWidth = 1.5;
  ctx.setLineDash([4, 3]);
  ctx.beginPath();
  ctx.moveTo(tx, pad.t);
  ctx.lineTo(tx, pad.t + plotH);
  ctx.stroke();
  ctx.setLineDash([]);

  ctx.fillStyle = '#f59e0b';
  ctx.font = '11px sans-serif';
  ctx.fillText(thresholdLabel + ': ' + fmt(threshold), tx + 4, pad.t + 14);

  // axes
  ctx.strokeStyle = '#333';
  ctx.lineWidth = 1;
  ctx.beginPath();
  ctx.moveTo(pad.l, pad.t + plotH);
  ctx.lineTo(pad.l + plotW, pad.t + plotH);
  ctx.stroke();

  ctx.fillStyle = '#666';
  ctx.font = '10px sans-serif';
  for (let i = 0; i <= 4; i++) {
    const v = min + (range * i / 4);
    const x = pad.l + (i / 4) * plotW;
    ctx.fillText(fmt(v), x, pad.t + plotH + 14);
  }
}

render();
